import './Slider.css';

const SliderAds = () =>{
    return (
        <div className="slider__discount">
            <div className="discount__container">
                <h1 className="discount__header">Rabat 10% na pierwsze zamówienie!</h1>
                <p className="ainfo__text">Do 20 stycznia złóż zamówienie na stronie i skorzystaj z promocji -10%. Spiesz się, czas trwania promocji do końca lutego.</p>
                <button className="ads__btn">Zamów online</button>
            </div>
        </div>
    )

}

export default SliderAds;
